import React, { useEffect } from "react";

function Movie() {
    const getMovie = () => {
        fetch("https://api.themoviedb.org/3/disover/movie?api_key=60bd9174f4fd1cedce1be342965af208")
        .then (res => res.json())
        .then (json => console.log(json))
    }

    useEffect(() => {
        getMovie();
    }, [])
    return (
        <div>Movie</div>
    )
}

export default Movie
